function createMedalsCsv(athlete_medals) {
  athlete_medals.forEach((athlete, i) => {
    athlete.goldMedals.forEach((medal) => {
      console.log('%s,%s,"%s","%s",gold', athlete.athleteName, athlete.countryName, medal.sportName, medal.eventName);
    });
    athlete.silverMedals.forEach((medal) => {
      console.log('%s,%s,"%s","%s",silver', athlete.athleteName, athlete.countryName, medal.sportName, medal.eventName);
    });
    athlete.bronzeMedals.forEach((medal) => {
      console.log('%s,%s,"%s","%s",bronze', athlete.athleteName, athlete.countryName, medal.sportName, medal.eventName);
    });
  });
}
function createMedalTableCsv(athlete_medals) {
  let country_medals = {};

  athlete_medals.map((a) => {
    let country_code = a.countryOdfCode;
    let e = country_medals[country_code];
    if (!e) {
      e = country_medals[country_code] = {
        country: country_code,
        gold: 0, silver: 0, bronze: 0,
        athletes: []
      };
    }
    e.gold += a.gold;
    e.silver += a.silver;
    e.bronze += a.bronze;
    e.athletes.push(a);
  });

  let v = [];
  for (let i in country_medals) {
    v.push(country_medals[i]);
  }
  function cmp(a, b) { if (a < b) return +1; else if (a > b) return -1; else return 0; }
  v.sort((a, b) => {
    if (a.gold != b.gold) return cmp(a.gold, b.gold);
    else if (a.silver != b.silver) return cmp(a.silver, b.silver);
    else if (a.bronze != b.bronze) return cmp(a.bronze, b.bronze);
    else return cmp(a.country < b.country);
  });
  v.map((e) => { console.log("%s,%d,%d,%d", e.country, e.gold, e.silver, e.bronze); });
}

